import React from "react";
import { Link } from "react-router-dom";
import "./style.css";

function Coding() {
  return (
  <div class="wrapper position-relative mb-4">
    <Link href="https://github.com/eurbaezjr">
      <img class="img-fluid" id="coding-image" src="https://www.imagesysit.com/images/easyblog_shared/November_2018/11-5-18/learning_code_400.jpg" alt="Full-Stack Coding"/>
      <div class="box-6 position-absolute">Coding Samples</div>
    </Link>
  </div>
  )
}

export default Coding;
